import React,{Component} from 'react'
import {Button, message} from 'antd'
import 'antd/dist/antd.less'

export default class App extends Component{
    render(){
        return(
            <div>
                <Button type='primary' onClick={this.handleClick}>Button</Button>
            </div>
        )
    }
    handleClick = ()=>{
        message.success('成功啦')
    }
}
